import React from 'react' ;
import Card from './Card';
import Button from './Button'


const ErrorModel = (props)  => {
    return (
      <Card>
        <div className="modal">
        <header className="header">
          <h2>{props.title}</h2>
        </header>
        <div className="content">
          <p>{props.message}</p>
        </div>
        <footer className="actions">
          <Button>Okay</Button>
        </footer>
        </div>
      </Card>
    );
}

export default ErrorModel;
